This might sound harsh but it is true. If you are serious about making a change then take a long hard look at how you fill the 168 hours of your week. 

We all have numerous pulls on our time. Children, work, household jobs, family, friends. Some have more or less of these time pressures than others. 

But we ALL make a choice. Do you choose to carve out a few hours a week to exercise or not? 

Neither is right or wrong by the way.

You might not be ready. That‚Äôs ok, but don‚Äôt hide behind not having enough time as a reason/excuse. We have all been in a situation where we feel like we couldn‚Äôt possibly be any busier but have then HAD to find time for more. Perhaps when having another child, or working more hours at work or fitting in more kids activities/homework as they get older.

It comes down to this. Are you going to chose to spend a few mins a day planning your meals and tracking them? Are you going to choose to make time for a few 30-40 minute workouts a week? The beauty of training online is that you don‚Äôt waste your getting to and from a gym or get distracted chatting, it‚Äôs literally the time it takes you to do the session. Again, it‚Äôs your choice how you workout.

