Spicy Shrimp and Cabbage Stir Fry
.
.
.
Ingredients 

1 pound large or jumbo shrimp, uncooked
1/2 head of cabbage, shredded (or ~12 oz bag pre-shredded cabbage)
2 tbsp low sodium soy sauce
1 tbsp hoisin sauce
1 tbsp rice vinegar
1/2 tbsp sriracha (or more to taste)
1 tsp honey
1/2 tsp ground ginger
1/4 tsp garlic powder
1 tsp sesame oil
1-2 tsp toasted sesame seeds, for garnish
1 tbsp chopped cilantro, for garnish

1. Preheat nonstick skillet (or wok) over medium high heat. In small bowl combine soy sauce, hoisin, rice vinegar, sriracha, honey, ginger, and garlic powder. Toss shrimp with 1-2 tbsp sauce. Add shrimp to skillet and cook 2-3 minutes or until shrimp are pink and cooked through. Remove from skillet and set aside.
2. In same skillet, add sesame oil and increase heat to high. Add cabbage and remaining sauce. Cook until softened and wilted, about 3-4 minutes. Add shrimp back and toss to combine. Garnish with toasted sesame seeds and chopped cilantro. Serves 3-4.

Nutritional Info (per 1/4th): 174 calories; 3.0 g fat; 10.2 g carbohydrates; 2.6 g fiber; 25.7 g protein.";}i:212;a:1:{s:14:"comments_count";i:2;}i:213;a:1:{s:11:"likes_count";i:4;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuiOJ9n5uE";}i:215;a:1:{s:5:"image";s:259:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118801854_332527184765352_7010355064477621487_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=V5ECDCYLuLIAX9dNslg&_nc_tp=15&oh=587116d18d717daaa69ecf23245e6038&oe=5F7DB243";}i:216;a:1:{s:4:"type";s:5:"image";}i:217;a:1:{s:8:"owner_id";i:541485501;}i:218;a:1:{s:14:"owner_username";s:0:"";}i:219;a:1:{s:14:"owner_fullname";s:0:"";}i:220;a:1:{s:9:"owner_pic";s:0:"";}i:221;a:1:{s:2:"id";s:19:"2390998527968159211";}i:222;a:1:{s:10:"short_code";s:11:"CEuiH4-BiXr";}i:223;a:1:{s:12:"created_time";i:1599249298;}i:224;a:1:{s:7:"caption";s:186:"A strong foundation may be the biggest üîë
